REPLACE INTO `list_target` (`id`, `created`, `updated`, `name`, `slug`, `status`, `subtext`) VALUES (1,'2021-07-02 00:18:03','2021-07-02 00:18:03','Goal 3 - Target 3.1','goal-3-target-3-1',1,'By 2030, reduce the global maternal mortality ratio to less than 70 per 100,000 live births');
